import { useParams } from 'react-router-dom';

function ArtImageTile({ galleries }) {
    let { id } = useParams();
    let gallery = galleries.find((gallery) => gallery.gallerynumber === id);
    return (
        <h1>{gallery.primaryimageurl}</h1>
    );
}

export default ArtImageTile;
